// =============== Helpers ===============

function normalizeDigits(str) {
  if (!str) return '';
  return String(str).replace(/\D+/g, '');
}

// Normalise any AU-looking phone number to digits starting with 0 and 10 digits if possible
function normalizeAuPhone(raw) {
  let digits = normalizeDigits(raw);
  if (!digits) return '';

  // Handle +61 / 61 prefix
  if (digits.startsWith('61')) {
    digits = '0' + digits.slice(2); // 61 4xx... -> 04xx...
  }

  // If it starts with 4 and is 9 digits, assume missing leading 0
  if (!digits.startsWith('0') && digits.length === 9 && digits.startsWith('4')) {
    digits = '0' + digits;
  }

  // At this point, typical AU number is "0xxxxxxxxx" (10 digits)
  return digits;
}

function formatAuPhoneFromDigits(digits) {
  if (!digits) return '';

  if (digits.length === 10 && digits.startsWith('04')) {
    // mobile 04xx xxx xxx
    return digits.replace(/(\d{4})(\d{3})(\d{3})/, '$1 $2 $3');
  }

  if (digits.length === 10 && digits.startsWith('0')) {
    // landline 0x xxxx xxxx
    return digits.replace(/(\d{2})(\d{4})(\d{4})/, '$1 $2 $3');
  }

  // fall back to raw digits if something odd
  return digits;
}

// Execution-time helper used ONLY to generate Timestamp now
function getExecutionTimes() {
  const now = new Date();
  return {
    executionBrisbane: now.toLocaleString('en-AU', {
      timeZone: 'Australia/Brisbane',
      hour12: false, // 24h format
    }),
    executionUtcIso: now.toISOString(),
    executionEpochMs: now.getTime(),
  };
}

// Simple AU-phone based spam logic
function isSpamLead(parsed) {
  const first = (parsed.firstName || '').trim();
  const last  = (parsed.lastName  || '').trim();

  const normPhone = normalizeAuPhone(parsed.phoneNumberRaw || '');

  const hasName  = first.length >= 2 && last.length >= 2;
  const hasPhone = normPhone.length >= 9; // allow 9–10 digits after normalisation

  const nameCombo = (first + ' ' + last).toLowerCase();

  if (!hasName || !hasPhone) return true;
  if (nameCombo.includes('test') || nameCombo.includes('asdf')) return true;
  if (nameCombo.includes('sdr')) return true;

  return false;
}

// =============== Facebook-specific parser ===============

// Handles strings like:
// "... Comments/Questions: ... Email: ... First Name: X Last Name: Y Phone Number: +61... Please Select What You Want Fixing:: ... Quantity: 1 Time Frame For Repairs?: now Which Suburb?: Kurwongbah View this lead in Privyr ..."
function parseFacebookText(rawText) {
  if (!rawText) return {};

  // Collapse whitespace so everything is on one line
  const text = rawText.replace(/\s+/g, ' ');

  const markerDefs = [
    { key: 'comments',       marker: 'Comments/Questions:' },
    { key: 'email',          marker: 'Email:' },
    { key: 'firstName',      marker: 'First Name:' },
    { key: 'lastName',       marker: 'Last Name:' },
    { key: 'phoneNumberRaw', marker: 'Phone Number:' },
    { key: 'service',        marker: 'Please Select What You Want Fixing::' },
    { key: 'quantity',       marker: 'Quantity:' },
    { key: 'timeFrame',      marker: 'Time Frame For Repairs?:' },
    { key: 'suburb',         marker: 'Which Suburb?:' },

    // Boundary AFTER suburb, so suburb doesn't eat the rest of the email
    { key: null,             marker: 'View this lead in Privyr' },
  ];

  const positions = [];

  for (const m of markerDefs) {
    const idx = text.indexOf(m.marker);
    if (idx === -1) continue;
    positions.push({
      key: m.key,
      markerIndex: idx,
      valueStart: idx + m.marker.length,
    });
  }

  if (!positions.length) return {};

  positions.sort((a, b) => a.markerIndex - b.markerIndex);

  const result = {};

  for (let i = 0; i < positions.length; i++) {
    const curr = positions[i];
    const next = positions[i + 1];
    const end  = next ? next.markerIndex : text.length;
    const value = text.slice(curr.valueStart, end).trim();
    if (curr.key && value) {
      result[curr.key] = value;
    }
  }

  // Fallback in case email marker fails
  if (!result.email) {
    const emailMatch = text.match(/[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}/i);
    if (emailMatch) result.email = emailMatch[0];
  }

  return result;
}

// =============== Main mapping ===============

// Snapshot execution time ONCE per Function node run
const execTime = getExecutionTimes();

return items.map(item => {
  const json    = item.json || {};
  const id      = json.id || '';
  const rawText = json.text || json.textHtml || json.snippet || '';

  const parsed = parseFacebookText(rawText);

  // Normalise & format phone
  const rawPhone   = parsed.phoneNumberRaw || '';
  const normDigits = normalizeAuPhone(rawPhone);

  let mobileFormatted = '';
  let phoneFormatted  = '';

  if (normDigits.startsWith('04') && normDigits.length === 10) {
    // treat as mobile
    mobileFormatted = formatAuPhoneFromDigits(normDigits);
  } else if (normDigits.startsWith('0') && normDigits.length === 10) {
    // treat as landline
    phoneFormatted = formatAuPhoneFromDigits(normDigits);
  } else if (normDigits) {
    // unknown style but keep it in Phone Number
    phoneFormatted = normDigits;
  }

  // Timestamp must match "Execution Time (Brisbane)" format
  const timestamp = execTime.executionBrisbane;

  const leadQualifier = isSpamLead(parsed) ? 'Spam' : 'Good';

  return {
    json: {
      // ===== Single timestamp field only =====
      Timestamp: timestamp,

      // ===== Original fields =====
      Id: id,

      // Hard-coded for this source
      'Lead Type': 'Facebook Lead',

      'First Name': parsed.firstName || '',
      'Last Name':  parsed.lastName  || '',
      'Mobile Number': mobileFormatted,
      'Phone Number':  phoneFormatted,
      'Email Address': parsed.email || '',
      'Address': '',
      State: '',
      Suburb: parsed.suburb || '',
      'Postal Code': '',
      Enquiry: parsed.comments || parsed.service || '',
      Quantity: parsed.quantity || '',
      "I'd Like To Get My Project Underway": parsed.timeFrame || '',
      'How they heard about us': 'Facebook',
      'Lead Qualifier': leadQualifier,
    },
  };
});

// n8n Code node (JavaScript) — FULL amended version (copy/paste)
//
// Fix: For addresses like "PO Box 1525, Fortitude Valley, 4006"
// ✅ Postal Code must be 4006 (NOT 1525)
// ✅ Suburb = Fortitude Valley
// ✅ Address = full address line (kept as-is)

const BUSINESS_EMAILS = new Set([
  // add your own company emails here if needed
]);

const BUSINESS_DOMAINS = new Set([
  // add your own domains here if needed
]);

function formatTimestampBrisbane(dateObj = new Date()) {
  const dtf = new Intl.DateTimeFormat('en-AU', {
    timeZone: 'Australia/Brisbane',
    year: 'numeric',
    month: '2-digit',
    day: '2-digit',
    hour: '2-digit',
    minute: '2-digit',
    second: '2-digit',
    hour12: false
  });
  return dtf.format(dateObj); // "15/01/2026, 17:21:03"
}

function getTimestamp(itemJson) {
  const candidates = [
    itemJson.date,
    itemJson.internalDate,
    itemJson.receivedAt,
    itemJson.timestamp,
    itemJson.Date
  ].filter(Boolean);

  if (candidates.length) {
    const d = new Date(candidates[0]);
    if (!isNaN(d.getTime())) return formatTimestampBrisbane(d);
  }
  return formatTimestampBrisbane(new Date());
}

function stripQuotedHistory(text) {
  const markers = [
    '-------- Original message --------',
    '\nOn ',
    '\r\nOn ',
  ];

  let cutIndex = -1;

  for (const mk of markers) {
    const idx = text.indexOf(mk);
    if (idx !== -1) cutIndex = (cutIndex === -1) ? idx : Math.min(cutIndex, idx);
  }

  const onWrote = text.search(/On\s+\w{3},\s+\d{1,2}\s+\w{3}\s+\d{4}.*wrote:/i);
  if (onWrote !== -1) cutIndex = (cutIndex === -1) ? onWrote : Math.min(cutIndex, onWrote);

  const latest = (cutIndex === -1) ? text : text.slice(0, cutIndex);
  return latest.trim();
}

function extractEmails(text) {
  const re = /[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}/gi;
  return Array.from(new Set(text.match(re) || []));
}

function extractEmailFromFromField(fromField) {
  if (!fromField) return "";
  const s = String(fromField);
  const m = s.match(/<\s*([^>]+@[^>]+)\s*>/);
  if (m) return m[1].trim();
  const m2 = s.match(/[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}/i);
  return m2 ? m2[0].trim() : "";
}

function isBusinessEmail(email) {
  if (!email) return false;
  const e = email.toLowerCase();
  if (BUSINESS_EMAILS.has(e)) return true;
  const parts = e.split("@");
  if (parts.length !== 2) return false;
  return BUSINESS_DOMAINS.has(parts[1]);
}

function pickBestLeadEmail(itemJson, text) {
  const fromEmail = extractEmailFromFromField(itemJson.from);
  if (fromEmail) return fromEmail;

  const wroteMatch = text.match(/<\s*([A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,})\s*>\s*wrote:/i);
  if (wroteMatch) {
    const candidate = wroteMatch[1];
    if (!isBusinessEmail(candidate)) return candidate;
  }

  const emails = extractEmails(text);
  const nonBiz = emails.find(e => !isBusinessEmail(e));
  return nonBiz || (emails[0] || "");
}

function extractPhones(text) {
  const re = /(\+?\d[\d\s().-]{6,}\d)/g;
  const raw = text.match(re) || [];
  const cleaned = raw
    .map(s => s.replace(/[().-]/g, " ").replace(/\s+/g, " ").trim())
    .filter(s => s.length >= 8);
  return Array.from(new Set(cleaned));
}

function formatMobileAU(raw) {
  if (!raw) return "";
  let s = raw.replace(/\s+/g, "").trim();

  if (s.startsWith("00")) s = "+" + s.slice(2);
  if (s.startsWith("+61")) s = "0" + s.slice(3);

  const digits = s.replace(/\D/g, "");
  if (digits.length !== 10) return "";
  if (!digits.startsWith("04")) return "";

  return `${digits.slice(0,4)} ${digits.slice(4,7)} ${digits.slice(7,10)}`;
}

function formatPhoneAU(raw) {
  if (!raw) return "";
  const digits = raw.replace(/\D/g, "");

  if (digits.length === 10 && digits.startsWith("1300")) {
    return `${digits.slice(0,4)} ${digits.slice(4,7)} ${digits.slice(7,10)}`;
  }

  if (digits.length === 10 && digits.startsWith("0")) {
    return `${digits.slice(0,2)} ${digits.slice(2,6)} ${digits.slice(6,10)}`;
  }

  if (digits.length === 8) {
    return `${digits.slice(0,4)} ${digits.slice(4,8)}`;
  }

  return "";
}

function pickMobileAndPhone(phones) {
  let mobile = "";
  let phone = "";

  for (const p of phones) {
    if (!mobile) {
      const fm = formatMobileAU(p);
      if (fm) {
        mobile = fm;
        continue;
      }
    }
    if (!phone) {
      const fp = formatPhoneAU(p);
      if (fp) phone = fp;
    }
  }
  return { mobile, phone };
}

function extractNameFromSignature(text) {
  const latest = stripQuotedHistory(text);

  const signoffRe = /(Warm Regards,|Regards,|Thanks,)\s*\n+([^\n|]+)(?:\s*\|\s*([^\n]+))?/i;
  const m = latest.match(signoffRe);
  if (m) {
    const name = (m[2] || "").trim();
    const company = (m[3] || "").trim();
    return { name: name || "", company: company || "" };
  }

  const pipeLine = latest
    .split('\n')
    .map(l => l.trim())
    .find(l => /\s\|\s/.test(l) && l.length <= 90);

  if (pipeLine) {
    const [left, right] = pipeLine.split('|').map(s => s.trim());
    return { name: left || "", company: right || "" };
  }

  const simple = latest.match(/(Warm Regards,|Regards,|Thanks,)\s*\n+([A-Za-z][A-Za-z .'-]{0,60})/i);
  if (simple) return { name: (simple[2] || "").trim(), company: "" };

  return { name: "", company: "" };
}

function splitFirstLast(fullName) {
  const n = (fullName || "").trim();
  if (!n) return { first: "", last: "" };
  const parts = n.split(/\s+/);
  if (parts.length === 1) return { first: parts[0], last: "" };
  return { first: parts[0], last: parts.slice(1).join(" ") };
}

function findAddressLine(latestText) {
  const lines = latestText.split('\n').map(l => l.trim()).filter(Boolean);

  const candidates = lines.filter(l =>
    /\b\d{4}\b/.test(l) &&
    l.includes(',') &&
    !/^on\s+\w{3},/i.test(l) &&
    !/^(from:|to:|subject:|date:)/i.test(l)
  );

  const strong = candidates.find(l => /(po box|street|st\b|road|rd\b|ave|avenue|drive|dr\b|court|ct\b|lane|ln\b|blvd|boulevard|cres|crescent|place|pl\b)/i.test(l));
  return strong || candidates[0] || "";
}

function parseAddressParts(addressLine) {
  // Key fix: choose the LAST 4-digit number in the line as postcode.
  // Example: "PO Box 1525, Fortitude Valley, 4006" -> postcode = 4006 (last 4-digit)
  if (!addressLine) return { address: "", suburb: "", postcode: "" };

  const matches = Array.from(addressLine.matchAll(/\b(\d{4})\b/g)).map(m => m[1]);
  const postcode = matches.length ? matches[matches.length - 1] : "";

  const parts = addressLine.split(',').map(p => p.trim());
  let suburb = "";

  // With "PO Box 1525, Fortitude Valley, 4006":
  // parts = ["PO Box 1525", "Fortitude Valley", "4006"]
  // suburb = parts[1]
  if (parts.length >= 2) {
    suburb = parts[parts.length - 2] || "";
  }

  return { address: addressLine, suburb, postcode };
}

function inferSuburbFromBody(latestText) {
  const t = latestText.replace(/\s+/g, " ").trim();
  if (t.length <= 40 && /^[A-Za-z][A-Za-z\s'-]+$/.test(t) && !/thanks|regards/i.test(t)) {
    return t;
  }
  return "";
}

function removeSignatureAndAddressFromLatest(latestText, addressLine) {
  let out = latestText;

  if (addressLine) {
    const escaped = addressLine.replace(/[.*+?^${}()|[\]\\]/g, '\\$&');
    out = out.replace(new RegExp(`\\n?${escaped}\\n?`, "g"), "\n");
  }

  out = out.replace(/\n(Warm Regards,|Regards,|Thanks,)\s*\n[\s\S]*$/i, "").trim();

  out = out
    .split('\n')
    .filter(line => {
      const l = line.trim();
      if (!l) return true;
      if (/^(m\.|p\.|toll free|brisbane|gold coast|email)\b/i.test(l)) return false;
      if (/[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}/i.test(l)) return false;
      if (/^\[image:|\[.*\.(jpg|png|pdf)\]$/i.test(l)) return false;
      if (/https?:\/\//i.test(l)) return false;
      return true;
    })
    .join('\n')
    .trim();

  return out;
}

function extractPostcodeFromEnquiry(latestText) {
  const m = latestText.match(/(?:\bpostcode\b|\bpost code\b|,\s*)(\d{4})\b/i);
  return m ? m[1] : "";
}

function choosePostalCode(addrPostcode, enquiryPostcode) {
  const pc = (addrPostcode || enquiryPostcode || "").trim();
  if (!/^\d{4}$/.test(pc)) return "";
  return pc;
}

function isSpam(text, fromEmail) {
  const t = (text || "").toLowerCase();
  const f = (fromEmail || "").toLowerCase();

  const keywordHits = [
    "winner", "won", "congratulations", "claim now", "urgent",
    "act now", "limited time", "risk-free", "100% free",
    "free gift", "investment opportunity", "crypto", "bitcoin",
    "forex", "casino", "gambling", "loan approval", "get rich",
    "wire transfer", "bank account", "porn", "adult", "escort"
  ].some(k => t.includes(k));

  const urlCount = (text.match(/https?:\/\/\S+/gi) || []).length;
  const manyUrls = urlCount >= 5;

  const unsubscribeHeavy = t.includes("unsubscribe") && (
    t.includes("marketing") || t.includes("promotion") || t.includes("newsletter") || t.includes("offer")
  );

  const fromLooksSpammy =
    f.endsWith(".xyz") || f.endsWith(".top") || f.endsWith(".click");

  if (keywordHits) return true;
  if (unsubscribeHeavy && manyUrls) return true;
  if (manyUrls && fromLooksSpammy) return true;

  return false;
}

return items.map(item => {
  const j = item.json || {};
  const id = j.id || "";
  const fullText = j.text || "";

  const latest = stripQuotedHistory(fullText);

  const addressLine = findAddressLine(latest);
  const addrParts = parseAddressParts(addressLine);

  const enquiryClean = removeSignatureAndAddressFromLatest(latest, addressLine);

  const suburbFromBody = inferSuburbFromBody(enquiryClean);
  const suburb = addrParts.suburb || suburbFromBody || "";

  const enquiryPc = extractPostcodeFromEnquiry(enquiryClean);
  const postalCode = choosePostalCode(addrParts.postcode, enquiryPc);

  const phones = extractPhones(latest);
  const { mobile, phone } = pickMobileAndPhone(phones);

  const sig = extractNameFromSignature(fullText);
  const nameParts = splitFirstLast(sig.name);

  const leadEmail = pickBestLeadEmail(j, fullText);

  const spam = isSpam(fullText, leadEmail);
  const leadQualifier = spam ? "Spam" : "Good";

  const output = {
    "Timestamp": getTimestamp(j),
    "Id": id,
    "Lead Type": "Email Enquiry Lead",
    "First Name": nameParts.first,
    "Last Name": nameParts.last,
    "Mobile Number": mobile,
    "Phone Number": phone,
    "Email Address": leadEmail,
    "Address": addrParts.address,
    "State": "",
    "Suburb": suburb,
    "Postal Code": postalCode,
    "Enquiry": enquiryClean,
    "Quantity": "",
    "I’d Like To Get My Project Underway": "",
    "How they heard about us": "",
    "Lead Qualifier": leadQualifier,
    "Referred By": ""
  };

  return { json: output };
});

// items: array of input items from Gmail Get Many
