  const id = json.id || '';
  const rawText = json.text || json.textPlain || json.snippet || '';

  const parsed = parseFormText(rawText);

  // Single "Phone Number" field → decide mobile vs landline
  const phoneRaw    = parsed.phoneNumberRaw || '';
  const phoneDigits = normalizeDigits(phoneRaw);
  let mobileFormatted = '';
  let phoneFormatted  = '';

  if (phoneDigits.startsWith('04') && phoneDigits.length === 10) {
    // AU mobile
    mobileFormatted = formatAuPhone(phoneRaw, 'mobile');
  } else if (phoneDigits.length === 10 && phoneDigits.startsWith('0')) {
    // AU landline
    phoneFormatted = formatAuPhone(phoneRaw, 'landline');
  } else if (phoneDigits) {
    // Non-AU or weird → keep raw digits in Phone Number (still marked as spam)
    phoneFormatted = phoneDigits;
  }

  const timestamp     = getBrisbaneDate(json);
  const leadQualifier = isSpamLead(parsed) ? 'Spam' : 'Good';

  return {
    json: {
      Timestamp: timestamp,
      Id: id,
