// items: array of input items from Gmail Get Many
// each item.json has at least: { id, text }

function normalizeDigits(str) {
  if (!str) return '';
  return String(str).replace(/\D+/g, '');
}

function formatAuPhone(raw, type) {
  if (!raw) return '';
  let digits = normalizeDigits(raw);
  if (!digits) return '';

  // Handle +61 or 61 prefix
  if (digits.startsWith('61')) {
    digits = '0' + digits.slice(2);
  } else if (!digits.startsWith('0') && digits.length >= 9) {
    // Assume missing leading 0
    digits = '0' + digits;
  }

  // Mobile
  if (type === 'mobile') {
    if (digits.length === 10) {
      // 04xx xxx xxx
      return digits.replace(/(\d{4})(\d{3})(\d{3})/, '$1 $2 $3');
    }
  }

  // Landline
  if (type === 'landline') {
    if (digits.length === 10) {
      // 0x xxxx xxxx
      return digits.replace(/(\d{2})(\d{4})(\d{4})/, '$1 $2 $3');
    }
  }

  // Fallback
  return digits;
}

function getBrisbaneDate(json) {
  let date;

  if (json.internalDate) {
    // Gmail internalDate is ms since epoch as string
    date = new Date(Number(json.internalDate));
  } else {
    // For your test payload (id + text only), just use "now"
    date = new Date();
  }

  // "dd/mm/yyyy, HH:MM:SS" in Australia/Brisbane
  return date.toLocaleString('en-AU', {
    timeZone: 'Australia/Brisbane',
    hour12: false, // 24-hour time
  });
}

// Parse "First NameDonLast NamePuertoEmail..." style text
function parseFormText(rawText) {
  if (!rawText) return {};

  // Remove newlines so markers are continuous
  const text = rawText.replace(/\r?\n/g, ' ');

  // Markers in the order they appear in the form
  const markerDefs = [
    { key: 'firstName',      marker: 'First Name' },
    { key: 'lastName',       marker: 'Last Name' },
    { key: 'email',          marker: 'Email' },
    { key: 'phoneNumberRaw', marker: 'Phone Number' },
    { key: 'suburb',         marker: 'Suburb' },
    { key: 'state',          marker: 'State' },
    { key: 'enquiry',        marker: 'Enquiry' },
    { key: 'projectTiming',  marker: "I'd Like To Get My Project Underway..." },
    { key: 'howHeard',       marker: 'How did yopu here about us' },
    // boundaries
    { key: null,             marker: 'Brands' },
    { key: null,             marker: 'Services' },
    { key: 'quantity',       marker: 'Quantity' }
  ];

  const positions = [];

  for (const m of markerDefs) {
    const idx = text.indexOf(m.marker);
    if (idx === -1) continue;
    positions.push({
      key: m.key,
      markerIndex: idx,
      valueStart: idx + m.marker.length,
    });
  }

  if (!positions.length) return {};

  // Sort by position
  positions.sort((a, b) => a.markerIndex - b.markerIndex);

  const result = {};

  for (let i = 0; i < positions.length; i++) {
    const curr = positions[i];
    const next = positions[i + 1];
    const end = next ? next.markerIndex : text.length;
    const value = text.slice(curr.valueStart, end).trim();

    if (curr.key && value) {
      result[curr.key] = value;
    }
  }

  // Fallback: email regex if not caught by marker
  if (!result.email) {
    const emailMatch = text.match(/[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}/i);
    if (emailMatch) result.email = emailMatch[0];
  }

  return result;
}

function isSpamLead(parsed) {
  const first = (parsed.firstName || '').trim();
  const last = (parsed.lastName || '').trim();
  const phoneRaw = parsed.phoneNumberRaw || '';
  const phoneDigits = normalizeDigits(phoneRaw);

  const hasName = first.length >= 2 && last.length >= 2;
  const hasPhone = phoneDigits.length >= 9;

  const nameCombo = (first + ' ' + last).toLowerCase();

  // Basic spam rules
  if (!hasName || !hasPhone) return true;
  if (nameCombo.includes('test') || nameCombo.includes('asdf')) return true;
  if (nameCombo.includes('sdr')) return true; // your SDR test names

  return false;
}

// Main mapping over items
return items.map(item => {
  const json = item.json || {};
  const id = json.id || '';
  const rawText = json.text || json.textPlain || json.snippet || '';

  const parsed = parseFormText(rawText);

  // Single "Phone Number" field → decide mobile vs landline
  const phoneRaw = parsed.phoneNumberRaw || '';
  const phoneDigits = normalizeDigits(phoneRaw);
  let mobileFormatted = '';
  let phoneFormatted = '';

  if (phoneDigits.startsWith('04') && phoneDigits.length === 10) {
    // AU mobile
    mobileFormatted = formatAuPhone(phoneRaw, 'mobile');
  } else if (phoneDigits.length === 10 && phoneDigits.startsWith('0')) {
    // AU landline
    phoneFormatted = formatAuPhone(phoneRaw, 'landline');
  } else if (phoneDigits) {
    phoneFormatted = phoneDigits;
  }

  const timestamp = getBrisbaneDate(json);
  const leadQualifier = isSpamLead(parsed) ? 'Spam' : 'Good';

  return {
    json: {
      Timestamp: timestamp,                     // e.g. "21/11/2025, 08:25:40"
      Id: id,
      'Lead Type': 'Sliding Door Lead',

      'First Name': parsed.firstName || '',
      'Last Name': parsed.lastName || '',
      'Mobile Number': mobileFormatted,
      'Phone Number': phoneFormatted,
      'Email Address': parsed.email || '',
      'Address': parsed.address || '',
      State: parsed.state || '',
      Suburb: parsed.suburb || '',
      'Postal Code': parsed.postalCode || '',
      Enquiry: parsed.enquiry || '',
      Quantity: parsed.quantity || '',
      "I'd Like To Get My Project Underway": parsed.projectTiming || '',
      'How they heard about us': parsed.howHeard || '',
      'Lead Qualifier': leadQualifier,

      referredBy: '',          // always empty string for Google Sheets

      _rawText: rawText
    }
  };
});

